import React, { Component } from "react";
import { Grid, Row, Col, Table } from "react-bootstrap";

import Card from "components/Card/Card.jsx";
import { thArray, tdArray } from "variables/Variables.jsx";

class Trucks extends Component {

  constructor(){
    super();
    this.state = {
      trucks : {}
    }
  }

  componentWillMount(){

    fetch('http://localhost/TmsId.Api/api/LafargeTms/getTrucks', {mode:'no-cors'})

    .then(response => response.json())

    .then(function(data){
      console.log(data.result);
    })

    // fetch('http://localhost/TmsId.Api/api/LafargeTms/getTrucks', obj)
    // .then(response => response.json())
    // .then(data => {
      // this.setState({
        // trucks:data.result
      // })
    // });
  }

  render() {
    return (
      <div className="content">
        <Grid fluid>
          <Row>
            <Col md={12}>
              <Card
                title="Lafarge Trucks"
                category="Trucks"
                ctTableFullWidth
                ctTableResponsive
                content={
                  <Table striped hover>
                    <thead>
                      <tr>
                        {thArray.map((prop, key) => {
                          return <th key={key}>{prop}</th>;
                        })}
                      </tr>
                    </thead>
                    <tbody>
                      {tdArray.map((prop, key) => {
                        return (
                          <tr key={key}>
                            {prop.map((prop, key) => {
                              return <td key={key}>{prop}</td>;
                            })}
                          </tr>
                        );
                      })}
                    </tbody>
                  </Table>
                }
              />
            </Col>
          </Row>
        </Grid>
      </div>
    );
  }
}

export default Trucks;
